import API from '../API';
import { useEffect, useState } from 'react';
import { Button, Spacer, CallFilled } from '@aircall/tractor';

import AppStyling from '../AppStyling';

import { makeStyles } from '@material-ui/core/styles';

const useStyles = makeStyles(AppStyling);

const CallList = ({ token, page }) => {
  const classes = useStyles();
  const [calls, setCalls] = useState([]);

  useEffect(() => {
    API.getCalls(token, page)
      .then(resp => resp.json())
      .then(data => setCalls(data));
  }, [token]);

  return (
    <Spacer space="s" width="400px !important" direction="vertical">
      {displayCalls(calls)}
    </Spacer>
  );
};

const displayCalls = calls => {
  console.log(calls.nodes);
  if (calls) {
    return calls.map(() => {
      return (
        <Button>
          <CallFilled />
          {calls.from}
        </Button>
      );
    });
  }
};

export default CallList;
